import React, { useState, useEffect } from 'react';

const App = () => {
  const [detailsFetched, setDetailsFetched] = useState(false);
  const [endpointDetails, setEndpointDetails] = useState([]);

  useEffect(() => {
    const fetchEndpointDetails = async () => {
      try {
        const response = await fetch('https://localhost/endpoints'); // Replace with your actual API endpoint
        const data = await response.json();

        // Extracting traderMandateId and traderName from each endpoint detail
        const results = data.map(endpoint => ({
          traderMandateId: endpoint.traderMandateId,
          traderName: endpoint.traderName
        }));

        setEndpointDetails(results);
        setDetailsFetched(true);
      } catch (error) {
        console.error('Error fetching endpoint details:', error);
      }
    };

    if (!detailsFetched) {
      fetchEndpointDetails();
    }
  }, [detailsFetched]);

  return (
    <div>
      <MandateAccessButton onClick={() => setDetailsFetched(false)} disabled={detailsFetched} />
      {detailsFetched && (
        <div>
          {endpointDetails.map((detail, index) => (
            <div key={index}>
              <h2>Endpoint Details {index + 1}</h2>
              <p>traderMandateId: {detail.traderMandateId}</p>
              <p>traderName: {detail.traderName}</p>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

const MandateAccessButton = ({ onClick, disabled }) => (
  <button onClick={onClick} disabled={disabled}>
    Fetch Endpoint Details
  </button>
);

export default App;
